column8:
カード型ケースにナイフを収納。<br>
持ち運びに便利なポケットナイフが登場です。<br>
<br>
薄いカード型なので、財布などに入れておけばすぐに使えて便利。<br>
栓抜きも搭載しているので、キャンプや釣りなどで大活躍!!<br>
<br>
ケースサイズ：約 8.5×5cm<br>
刃渡り：65mm<br>
材質：ABS、ステンレス（刃）<br>
生産国：中国<br>
<br>
※海外製造品のため、軽微な傷や汚れ、サビ等ある場合がございます。<br>
