銃弾がナイフに変身!! オシャレなキーホルダータイプ♪<br>
<br>
ちょっとした小物を切りたいときなど、<br>
キーホルダーとして持ち歩いておけば、すぐに取り出して使えて便利!!<br>
<br>
デザインも渋くて格好良い!!<br>
<br>
